import{_ as e,c as r,o,a4 as a}from"./chunks/framework.DBIahkuf.js";const i="/AINotes/assets/20ad8538069947b8831c09e9b60a5a0etplv-k3u1fbpfcp-zoom-in-crop-mark1512000.COHci5m2.webp",t="/AINotes/assets/26be141daa4340fbbca9eacc5c16512etplv-k3u1fbpfcp-zoom-in-crop-mark1512000.uCrpOFoO.webp",d="/AINotes/assets/18b7e6d6bc724d61a5d20520c4220293tplv-k3u1fbpfcp-zoom-in-crop-mark1512000.BnAfFqe0.webp",b=JSON.parse('{"title":"Midjourney使用问题","description":"","frontmatter":{},"headers":[],"relativePath":"Document/AI绘画工具/Midjourney AI绘画工具/2.Midjourney使用问题.md","filePath":"Document/AI绘画工具/Midjourney AI绘画工具/2.Midjourney使用问题.md","lastUpdated":1708941732000}'),n={name:"Document/AI绘画工具/Midjourney AI绘画工具/2.Midjourney使用问题.md"},p=a('<h1 id="midjourney使用问题" tabindex="-1">Midjourney使用问题 <a class="header-anchor" href="#midjourney使用问题" aria-label="Permalink to &quot;Midjourney使用问题&quot;">​</a></h1><h2 id="问题1-midjourney是什么" tabindex="-1">问题1：Midjourney是什么？ <a class="header-anchor" href="#问题1-midjourney是什么" aria-label="Permalink to &quot;问题1：Midjourney是什么？&quot;">​</a></h2><p>Midjourney 是 AI 生成算图工具，输入文字就会自动产生图像，目前架设在Discord频道上。</p><h2 id="问题2-discord频道是什么" tabindex="-1">问题2：Discord频道是什么？ <a class="header-anchor" href="#问题2-discord频道是什么" aria-label="Permalink to &quot;问题2：Discord频道是什么？&quot;">​</a></h2><p>Discord是国外的一个社群工具，类似QQ，Discord频道就类似QQ群。</p><p>Midjourney的使用方式是：通过给频道内的聊天机器人发送对应文本，聊天机器人返回对应的图片。</p><p>所以想用Midjourney，就要先注册一个Discord，然后进入Midjourney的Discord频道。</p><h2 id="问题3-midjourney图片版权归属" tabindex="-1">问题3：Midjourney图片版权归属？ <a class="header-anchor" href="#问题3-midjourney图片版权归属" aria-label="Permalink to &quot;问题3：Midjourney图片版权归属？&quot;">​</a></h2><p>版权归属于创作者，自己用关键词去生成！</p><h2 id="问题4-midjourney对硬件配置有要求吗" tabindex="-1">问题4：Midjourney对硬件配置有要求吗？ <a class="header-anchor" href="#问题4-midjourney对硬件配置有要求吗" aria-label="Permalink to &quot;问题4：Midjourney对硬件配置有要求吗？&quot;">​</a></h2><p>部署在网络，而不是在本地，所以对本机硬件无要求，但因为国外的公司，需要可以魔法上网。</p><h2 id="问题5-经常看到prompt-prompt到底是什么" tabindex="-1">问题5：经常看到prompt，prompt到底是什么？ <a class="header-anchor" href="#问题5-经常看到prompt-prompt到底是什么" aria-label="Permalink to &quot;问题5：经常看到prompt，prompt到底是什么？&quot;">​</a></h2><p>其实就是关键字（提示词），是你提供给Midjourney的文本，Midjourney依靠文本提示词来生成图片，Midjourney<strong>关键词就是AI绘图的灵魂</strong>，它直接影响你出图图片的质量！</p><p>大家记住：即使Midjourney关键词一样（修改任意一个元素 后），也没关系，只要是你自己生成的图品，你才有权限使用：</p><h2 id="问题6-midjourney免费吗-midjourney要钱吗" tabindex="-1">问题6：Midjourney免费吗？Midjourney要钱吗？ <a class="header-anchor" href="#问题6-midjourney免费吗-midjourney要钱吗" aria-label="Permalink to &quot;问题6：Midjourney免费吗？Midjourney要钱吗？&quot;">​</a></h2><p>Midjourney 开始时免费，每个账号能生成25张图片。到达图片上限后，需要购买Midjourney会员。</p><p>但是现在已经没有了活动，都需要开通会员来生成。</p><h2 id="问题7-midjourney会员多少钱" tabindex="-1">问题7：Midjourney会员多少钱？ <a class="header-anchor" href="#问题7-midjourney会员多少钱" aria-label="Permalink to &quot;问题7：Midjourney会员多少钱？&quot;">​</a></h2><p>主要分为：</p><p>基础版会员（10美金一个月，一个月可以制作200张图）</p><p>标准版会员（30美金一个月，无限制作图，有15小时快速出图模式）</p><p>可以一个号登录5台设备</p><h2 id="问题8-midjourney如何购买会员" tabindex="-1">问题8：Midjourney如何购买会员？ <a class="header-anchor" href="#问题8-midjourney如何购买会员" aria-label="Permalink to &quot;问题8：Midjourney如何购买会员？&quot;">​</a></h2><p>需要使用可以支持外币支付的信用卡进行购买！</p><h2 id="问题9-midjourney社区里-我为什么无法查看别人的作品和prompt" tabindex="-1">问题9：Midjourney社区里，我为什么无法查看别人的作品和prompt？ <a class="header-anchor" href="#问题9-midjourney社区里-我为什么无法查看别人的作品和prompt" aria-label="Permalink to &quot;问题9：Midjourney社区里，我为什么无法查看别人的作品和prompt？&quot;">​</a></h2><p>因为你需要先升级为Midjourney会员，才可以使用社区功能，查看更多作品。</p><h2 id="问题10-fast模式和relax模式有什么差别" tabindex="-1">问题10：Fast模式和Relax模式有什么差别？ <a class="header-anchor" href="#问题10-fast模式和relax模式有什么差别" aria-label="Permalink to &quot;问题10：Fast模式和Relax模式有什么差别？&quot;">​</a></h2><p>在输入框输入“/fast”或者“/relax” 即可切换模式，默认是fast模式</p><p>fast模式：无需排队，发送prompt立马绘图，（30美金会员，支持15小时Fast模式）</p><p>relax模式：需要排队，排队完成自动生成。</p><h2 id="问题11-如何查看自己生成过的历史作品" tabindex="-1">问题11：如何查看自己生成过的历史作品？ <a class="header-anchor" href="#问题11-如何查看自己生成过的历史作品" aria-label="Permalink to &quot;问题11：如何查看自己生成过的历史作品？&quot;">​</a></h2><p>进入Midjourney网站，点击右边的“sign in”进入自己的主页。在这里可以找到图片的描述、位置以及下载。</p><h2 id="问题12-账号被封解决" tabindex="-1">问题12：账号被封解决 <a class="header-anchor" href="#问题12-账号被封解决" aria-label="Permalink to &quot;问题12：账号被封解决&quot;">​</a></h2><p>如果账号绑定了手机号，被封了，咋办？</p><ol><li>建议换个账号</li><li>申请解封，我试了下，还在等反馈，毕竟珍惜账号的可以试试；</li></ol><p><img src="'+i+'" alt=" "></p><p>刚注册...发现账号就被封了...好像跟中国电话注册有关，但是网上也没看到。于是我参考教程进行了解封申请，具体如下：</p><ul><li>进入 <a href="https://support.discord.com/hc/zh-tw/requests/new?ticket_form_id=360000029731%E7%94%B3%E8%AF%B7%E8%A7%A3%E5%B0%81" target="_blank" rel="noreferrer">https://support.discord.com/hc/zh-tw/requests/new?ticket_form_id=360000029731申请解封</a></li><li>电子邮箱地址就写需要解封的邮箱；</li></ul><p><img src="'+t+'" alt=" "></p><ul><li>标题和描述就真实写，比如我是<strong>刚注册就被封了</strong>，就直接用软件翻译一下写： <ul><li>标题：<code>Account just registered was blocked, apply to cancel</code></li><li>描述：<code>Account was unblocked as soon as I registered, I did not violate any rules or regulations</code></li></ul></li></ul><p><img src="'+d+'" alt=" "></p><ul><li>提交后就有一个反馈邮件，然后等几天等Discord核实；</li></ul>',42),s=[p];function u(l,c,h,m,y,j){return o(),r("div",null,s)}const f=e(n,[["render",u]]);export{b as __pageData,f as default};
